using System;
using UnityEditor;
using UnityEngine;

[Serializable]
public static class HomaGamesStyle
{
    #region Base64 Images
    [SerializeField]
    private const string HOMA_GAMES_LOGO_BASE_64 = "";
    [SerializeField]
    private const string HOMA_GAMES_WHITE_BUTTON_BG_BASE64 = "";
    [SerializeField]
    private const string HOMA_GAMES_CYAN_BUTTON_BG_BASE64 = "";
    [SerializeField]
    private const string UPDATE_ICON = "";
    [SerializeField]
    private const string DEBUG_ICON = "";
    [SerializeField]
    private const string WARNING_ICON = "";
    [SerializeField]
    private const string ERROR_ICON = "";
    [SerializeField]
    private const string WHITE_CIRCLE_ICON = "";
    [SerializeField]
    private const string FOUND_ICON = "";
    [SerializeField]
    private const string NOT_FOUND_ICON = "";
    [SerializeField]
    private const string INPUT_FIELD_BACKGROUND = "";
    [SerializeField]
    private const string BUTTON_BACKGROUND = "";
    [SerializeField]
    private const string BUTTON_BACKGROUND_PRESSED = "";
    [SerializeField]
    private const string DOWNLOAD_ICON = "";
    #endregion

    #region Colors
    [SerializeField]
    private const string HOMA_GAMES_CYAN = "#47D7AC";
    [SerializeField]
    private const string HOMA_GAMES_GRAY = "#4B4C5B";
    [SerializeField]
    private const string HOMA_GAMES_BONE_WHITE = "#F6F7F7";
    [SerializeField]
    private const string MAIN_LABEL_TEXT_COLOR = "#2D2D38";
    [SerializeField]
    private const string SECONDARY_LABEL_TEXT_COLOR = "#4C4C5E";
    [SerializeField]
    private const string ERROR_LABEL_TEXT_COLOR = "#FF0000";
    [SerializeField]
    private const string INPUT_FIELD_TEXT_COLOR = "#676775";
    [SerializeField]
    private const string DARK_GREY = "#4C4C5E";
    [SerializeField]
    private static Color cyanColor;
    [SerializeField]
    private static Color grayColor;
    [SerializeField]
    private static Color boneWhiteColor;
    [SerializeField]
    private static Color mainLabelTextColor;
    [SerializeField]
    private static Color secondaryLabelTextColor;
    [SerializeField]
    private static Color errorLabelTextColor;
    [SerializeField]
    private static Color inputFieldTextColor;
    [SerializeField]
    private static Color darkGreyColor;
    #endregion

    #region Textures
    [SerializeField]
    private static Texture2D whiteButtonBackgroundTexture;
    [SerializeField]
    private static Texture2D cyanButtonBackgroundTexture;
    [SerializeField]
    private static Texture2D darkGreyBackgroundTexture;
    [SerializeField]
    private static Texture2D inputFieldBackgroundTexture;
    [SerializeField]
    private static Texture2D buttonBackgroundTexture;
    [SerializeField]
    private static Texture2D buttonBackgroundPressedTexture;
    #endregion

    #region Public properties
    // Const values
    public const int HOMA_GAMES_LOGO_WITH = 160;
    public const int HOMA_GAMES_LOGO_HEIGHT = 70;

    // Textures
    public static Texture2D BackgroundTexture;
    public static Texture2D LogoTexture;

    // Styles
    public static GUIStyle MainLabelStyle;
    public static GUIStyle MainInputFieldStyle;
    public static GUIStyle SecondaryLabelStyle;
    public static GUIStyle ErrorLabelStyle;
    public static GUIStyle ButtonStyleTexts;
    public static GUIStyle ButtonOnlyTextStyle;
    public static GUIStyle ButtonOnlyTextCyanStyle;
    public static GUIStyle ButtonStyleIcon;
    public static GUIStyle DarkGreyBoxStyle;
    public static GUIStyle LogLabelStyle;
    public static GUIStyle ProgressBarBackgroundStyle;
    public static GUIStyle ProgressBarForegroundStyle;

    // Scrollbars
    public static GUIStyle VerticalScrollbarStyle;
    public static GUIStyle HorizontalScrollbarStyle;

    // Icons
    public static Texture2D DebugIcon;
    public static Texture2D WarningIcon;
    public static Texture2D ErrorIcon;
    public static Texture2D FoundIcon;
    public static Texture2D NotFoundIcon;
    public static Texture2D UpdateIcon;
    public static Texture2D DownloadIcon;
    public static Texture2D WhiteCircleIcon;
    #endregion

    [InitializeOnLoadMethod]
    public static void InitializeOnLoad()
    {
        ParseColors();
        CreateTextures();
        CreateStyles();
    }

    private static void ParseColors()
    {
        // Load colors
        ColorUtility.TryParseHtmlString(HOMA_GAMES_GRAY, out grayColor);
        ColorUtility.TryParseHtmlString(HOMA_GAMES_CYAN, out cyanColor);
        ColorUtility.TryParseHtmlString(HOMA_GAMES_BONE_WHITE, out boneWhiteColor);
        ColorUtility.TryParseHtmlString(MAIN_LABEL_TEXT_COLOR, out mainLabelTextColor);
        ColorUtility.TryParseHtmlString(SECONDARY_LABEL_TEXT_COLOR, out secondaryLabelTextColor);
        ColorUtility.TryParseHtmlString(ERROR_LABEL_TEXT_COLOR, out errorLabelTextColor);
        ColorUtility.TryParseHtmlString(INPUT_FIELD_TEXT_COLOR, out inputFieldTextColor);
        ColorUtility.TryParseHtmlString(DARK_GREY, out darkGreyColor);
    }

    private static void CreateStyles()
    {
        MainLabelStyle = new GUIStyle()
        {
            fixedHeight = 20,
            margin = new RectOffset(10, 10, 10, 10),
            alignment = TextAnchor.MiddleCenter,
            fontStyle = FontStyle.Bold,
            fontSize = 16,
            font = (Font) Resources.Load("Poppins-Bold.ttf", typeof(Font))
        };
        MainLabelStyle.normal.textColor = mainLabelTextColor;

        MainInputFieldStyle = new GUIStyle()
        {
            margin = new RectOffset(10, 10, 10, 10),
            fixedWidth = 267,
            fixedHeight = 42,
            fontSize = 16,
            alignment = TextAnchor.MiddleCenter,
            font = (Font)Resources.Load("Poppins-Regular.ttf", typeof(Font))
        };
        MainInputFieldStyle.normal.background = inputFieldBackgroundTexture;
        MainInputFieldStyle.normal.textColor = inputFieldTextColor;
        MainInputFieldStyle.active.background = inputFieldBackgroundTexture;
        MainInputFieldStyle.active.textColor = inputFieldTextColor;
        MainInputFieldStyle.focused.background = inputFieldBackgroundTexture;
        MainInputFieldStyle.focused.textColor = inputFieldTextColor;

        SecondaryLabelStyle = new GUIStyle()
        {
            font = (Font)Resources.Load("Poppins-Regular.ttf", typeof(Font))
        };
        SecondaryLabelStyle.normal.textColor = secondaryLabelTextColor;
        SecondaryLabelStyle.alignment = TextAnchor.MiddleCenter;
        SecondaryLabelStyle.fontSize = 14;

        ErrorLabelStyle = new GUIStyle()
        {
            font = (Font)Resources.Load("Poppins-Regular.ttf", typeof(Font))
        };
        ErrorLabelStyle.normal.textColor = errorLabelTextColor;
        ErrorLabelStyle.alignment = TextAnchor.MiddleCenter;
        ErrorLabelStyle.fontSize = 12;

        LogLabelStyle = new GUIStyle()
        {
            alignment = TextAnchor.MiddleLeft,
            font = (Font)Resources.Load("Poppins-Regular.ttf", typeof(Font))
        };
        LogLabelStyle.normal.textColor = Color.white;
        LogLabelStyle.fontSize = 12;

        ButtonStyleTexts = new GUIStyle()
        {
            margin = new RectOffset(10, 10, 10, 10),
            padding = new RectOffset(0, 0, 0, 5),
            fixedWidth = 275,
            fixedHeight = 50,
            stretchWidth = true,
            fontSize = 16,
            fontStyle = FontStyle.Bold,
            alignment = TextAnchor.MiddleCenter,
            font = (Font)Resources.Load("Poppins-Bold.ttf", typeof(Font))
        };
        ButtonStyleTexts.normal.textColor = Color.white;
        ButtonStyleTexts.normal.background = buttonBackgroundTexture;
        ButtonStyleTexts.active.textColor = Color.white;
        ButtonStyleTexts.active.background = buttonBackgroundPressedTexture;

        DarkGreyBoxStyle = new GUIStyle()
        {
            stretchWidth = true,
            stretchHeight = true
        };
        DarkGreyBoxStyle.normal.background = darkGreyBackgroundTexture;

        VerticalScrollbarStyle = new GUIStyle()
        {
            
        };

        HorizontalScrollbarStyle = new GUIStyle()
        {

        };

        ButtonOnlyTextStyle = new GUIStyle()
        {
            font = (Font)Resources.Load("Poppins-Bold.ttf", typeof(Font))
        };
        ButtonOnlyTextStyle.normal.textColor = secondaryLabelTextColor;
        ButtonOnlyTextStyle.fontStyle = FontStyle.Bold;
        ButtonOnlyTextStyle.fontSize = 14;

        ButtonOnlyTextCyanStyle = new GUIStyle()
        {
            font = (Font)Resources.Load("Poppins-Bold.ttf", typeof(Font))
        };
        ButtonOnlyTextCyanStyle.normal.textColor = cyanColor;
        ButtonOnlyTextCyanStyle.fontStyle = FontStyle.Bold;
        ButtonOnlyTextCyanStyle.fontSize = 14;

        ProgressBarBackgroundStyle = new GUIStyle()
        {
            padding = new RectOffset(2, 2, 2, 2),
            fixedHeight = 24,
            fixedWidth = 200,
            alignment = TextAnchor.MiddleLeft
        };
        ProgressBarBackgroundStyle.normal.background = inputFieldBackgroundTexture;
        ProgressBarBackgroundStyle.active.background = inputFieldBackgroundTexture;

        ProgressBarForegroundStyle = new GUIStyle()
        {
            fixedHeight = 20
        };
        ProgressBarForegroundStyle.normal.background = buttonBackgroundTexture;
        ProgressBarForegroundStyle.active.background = buttonBackgroundTexture;
    }

    private static void CreateTextures()
    {
        BackgroundTexture = new Texture2D(1, 1, TextureFormat.RGBA32, false);
        BackgroundTexture.hideFlags = HideFlags.DontSave;
        BackgroundTexture.SetPixel(0, 0, boneWhiteColor);
        BackgroundTexture.Apply();

        darkGreyBackgroundTexture = new Texture2D(1, 1, TextureFormat.RGBA32, false);
        darkGreyBackgroundTexture.hideFlags = HideFlags.DontSave;
        darkGreyBackgroundTexture.SetPixel(0, 0, darkGreyColor);
        darkGreyBackgroundTexture.Apply();

        LogoTexture = new Texture2D(HOMA_GAMES_LOGO_WITH, HOMA_GAMES_LOGO_HEIGHT, TextureFormat.RGBA32, false);
        LogoTexture.hideFlags = HideFlags.DontSave;
        LogoTexture.LoadImage(System.Convert.FromBase64String(HOMA_GAMES_LOGO_BASE_64));

        whiteButtonBackgroundTexture = new Texture2D(44, 44, TextureFormat.RGBA32, false);
        whiteButtonBackgroundTexture.hideFlags = HideFlags.DontSave;
        whiteButtonBackgroundTexture.LoadImage(System.Convert.FromBase64String(HOMA_GAMES_WHITE_BUTTON_BG_BASE64));

        cyanButtonBackgroundTexture = new Texture2D(44, 44, TextureFormat.RGBA32, false);
        cyanButtonBackgroundTexture.hideFlags = HideFlags.DontSave;
        cyanButtonBackgroundTexture.LoadImage(System.Convert.FromBase64String(HOMA_GAMES_CYAN_BUTTON_BG_BASE64));

        DebugIcon = new Texture2D(44, 44, TextureFormat.RGBA32, false);
        DebugIcon.hideFlags = HideFlags.DontSave;
        DebugIcon.LoadImage(System.Convert.FromBase64String(DEBUG_ICON));

        WarningIcon = new Texture2D(44, 44, TextureFormat.RGBA32, false);
        WarningIcon.hideFlags = HideFlags.DontSave;
        WarningIcon.LoadImage(System.Convert.FromBase64String(WARNING_ICON));

        ErrorIcon = new Texture2D(44, 44, TextureFormat.RGBA32, false);
        ErrorIcon.hideFlags = HideFlags.DontSave;
        ErrorIcon.LoadImage(System.Convert.FromBase64String(ERROR_ICON));

        FoundIcon = new Texture2D(44, 44, TextureFormat.RGBA32, false);
        FoundIcon.hideFlags = HideFlags.DontSave;
        FoundIcon.LoadImage(System.Convert.FromBase64String(FOUND_ICON));

        NotFoundIcon = new Texture2D(44, 44, TextureFormat.RGBA32, false);
        NotFoundIcon.hideFlags = HideFlags.DontSave;
        NotFoundIcon.LoadImage(System.Convert.FromBase64String(NOT_FOUND_ICON));

        DownloadIcon = new Texture2D(44, 44, TextureFormat.RGBA32, false);
        DownloadIcon.hideFlags = HideFlags.DontSave;
        DownloadIcon.LoadImage(System.Convert.FromBase64String(DOWNLOAD_ICON));

        UpdateIcon = new Texture2D(44, 44, TextureFormat.RGBA32, false);
        UpdateIcon.hideFlags = HideFlags.DontSave;
        UpdateIcon.LoadImage(System.Convert.FromBase64String(UPDATE_ICON));

        WhiteCircleIcon = new Texture2D(44, 44, TextureFormat.RGBA32, false);
        WhiteCircleIcon.hideFlags = HideFlags.DontSave;
        WhiteCircleIcon.LoadImage(System.Convert.FromBase64String(WHITE_CIRCLE_ICON));

        inputFieldBackgroundTexture = new Texture2D(267, 42, TextureFormat.RGBA32, false);
        inputFieldBackgroundTexture.hideFlags = HideFlags.DontSave;
        inputFieldBackgroundTexture.LoadImage(System.Convert.FromBase64String(INPUT_FIELD_BACKGROUND));

        buttonBackgroundTexture = new Texture2D(275, 50, TextureFormat.RGBA32, false);
        buttonBackgroundTexture.hideFlags = HideFlags.DontSave;
        buttonBackgroundTexture.LoadImage(System.Convert.FromBase64String(BUTTON_BACKGROUND));

        buttonBackgroundPressedTexture = new Texture2D(275, 50, TextureFormat.RGBA32, false);
        buttonBackgroundPressedTexture.hideFlags = HideFlags.DontSave;
        buttonBackgroundPressedTexture.LoadImage(System.Convert.FromBase64String(BUTTON_BACKGROUND_PRESSED));
    }
}

